import React from 'react';
import './navbar.css';

// the onClick function for the clicked image so you can tell if it's been clicked before
const Navbar = props => (
  <nav className="navbar">
    <a href = "/">Clicky Game</a>

  score = {props.score}

  </nav>
);

export default Navbar;
